import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import CreateTable from "./FullTable"
import FormPop from "./FormPop"


function App() {
  return (

    <div>
      <Header />
      <CreateTable />
      <button>Open Popup</button>
      <FormPop trigger={false}>
        <h1>Hellooo</h1>
      </FormPop>
      <Footer />
    </div>

  );
}

export default App;
